import React, { Component } from 'react';

import './App.css';

class APP extends Component {

  constructor(props){
    super(props);
    this.state={value:''}
  }

  render(){
    return(
      <div className="Tasklist">
      <form>
               <div className="header" >
                   <h1>Task list</h1>
               </div>
               <div className="body">
                   <div className="tasks">
                      <input type="text" 
                             placeholder="Your Tasks"
                             onChange={(e)=>handleChange(e)}/>
                   </div>
               </div>
       </form>
   </div>
    )
  }
}




export default App;
